INSERT INTO `categories` (`id`, `store_id`, `category_name`, `category_desc`, `category_img`, `is_header`, `is_footer`, `order_index`, `is_active`) VALUES
(20, 1, 'Flower Vase', 'Flower Vase', '1754127380_1.jpg', 0, 1, 8, 1),
(19, 1, 'Wall Painting', 'Wall Painting', '1755060185_1.jpg', 1, 0, 7, 1),
(15, 1, 'Home decor', 'show pieces', '1755059164_1.jpeg', 1, 1, 3, 1),
(13, 1, 'Bedsheets', 'Transform Your Bedroom with Stylish Vaaree Bedsheets', '1754021282_1.jpg', 1, 1, 13, 1),
(21, 1, 'Metal vase', 'In vases ', '1754130070_1.jpg', 0, 1, 9, 1),
(23, 1, 'Candle stand', 'A decorative item designed to hold a candle stick ', '1754652489_1.jpg', 0, 1, 10, 1),
(24, 1, 'Tissue Box', 'A convenient and essential household accessory, the tissue box provides easy access to soft, disposable tissues for everyday use.', '1755006998_1.jpeg', 0, 0, 11, 1),
(31, 1, 'Sacred Statues & Figurines', 'Bring home this timeless devotional piece that blends spirituality with artistic craftsmanship ‚Äî a perfect choice for enhancing your sacred space or gifting your loved ones.', '1757929691_1.png', 0, 1, 12, 1),
(32, 1, 'Blue Pottery Treasures', 'Bring timeless elegance into your home with our Blue Pottery Treasures collection. Featuring exquisite blue and white ceramic decor, each piece is carefully crafted to add a touch of artistry and charm to your living spaces. Perfect for home prayer rooms, living areas, or gifting, these treasures blend traditional craftsmanship with modern style.', 'EBACE8D7-19B5-4D18-844A-A8D306B9454F.png', 0, 1, 2, 1),
(43, 1, 'Christmas Home Linen ', 'Wrap your home in warmth and style with our premium home linen collection. From luxuriously soft bed sheets and duvet covers to plush cushion covers, table runners, and throws, each piece is designed to bring effortless elegance and cozy comfort to your living spaces. Crafted from high-quality fabrics with fine detailing, our home linen adds a refined touch ‚Äî perfect for everyday living or festive celebrations.', '5AAD5C2D-5EBC-46AF-84CD-929910D1E73D.png', 1, 1, 22, 1),
(40, 1, 'Kitchen Delight Collection', 'Transform your cooking space into a place of joy and style with our Kitchen Delight Collection. Featuring functional yet decorative pieces‚Äîfrom chef-themed oil & vinegar sets to charming kitchen accents‚Äîeach item is designed to bring both convenience and character to your home. Perfect for adding a touch of warmth, whimsy, and elegance to everyday cooking and dining.', '45.png', 0, 1, 19, 1),
(41, 1, 'Christmas Luxe D√©cor', 'Transform your home into a winter wonderland with our Christmas Luxe D√©cor Collection. From elegant ceramic accents and festive tableware to sparkling ornaments and timeless statement pieces, each item is curated to bring warmth, charm, and sophistication to your holiday celebrations. Perfect for creating cozy corners, dressing up mantels, and gifting loved ones this festive season.', '1.png', 1, 1, 1, 1),
(42, 1, 'clocks', 'Discover an exclusive collection of wall clocks that combine style and precision. From classic railway-inspired designs to sleek modern pieces, our clocks make every room more elegant while keeping you perfectly on time. Perfect for homes, offices, and gifting.', 'cb3ebab8-6b0b-4923-8fc8-1ba3df9c69a5.png', 1, 1, 21, 0);
